window.bookSummaryJSON = "<p>Ten years ago, there was a battle, a curse, and a princess. It sounds like a fairy tale. It isn’t.</p> <p>Still deep in her eversleep, powering the wards of the last fae sanctuary, Vlari has one adversary to fight: time. Time for the folk to gain the weapons they need to fight against the invaders.</p> <p>Each passing day, she’s less likely to awaken. Drusk has ceased to hope she ever will, until something changes at the very core of Tenebris.</p>"; 
